-- 08 linhas
CREATE TABLE IF NOT EXISTS public.Banks
(
	id integer NOT NULL,
	code varchar(10) UNIQUE NOT NULL,
	name varchar(250),
	ispb varchar(8),
	CONSTRAINT banks_pkey PRIMARY KEY (id)
);


-- 2000 linhas
CREATE TABLE IF NOT EXISTS public.Accounts
(
	id integer NOT NULL,
	type varchar(20) NOT NULL,
	idCustomer integer,
	taxpayerIdentification varchar(50),
	idBank integer  NOT NULL,
	accountNumber varchar(125),
	active boolean,
	dtCreated date,
    CONSTRAINT accounts_pkey PRIMARY KEY (id),
	CONSTRAINT accounts_type_fkey FOREIGN KEY (type)
        REFERENCES public.AccountType (type) MATCH SIMPLE,
	CONSTRAINT accounts_code_fkey FOREIGN KEY (idBank)
        REFERENCES public.Banks (id) MATCH SIMPLE
);


