-- 1000 linhas
CREATE TABLE IF NOT EXISTS public.Individuals 
(
	id integer NOT NULL,
	
	firstName varchar(50) NOT NULL,
	lastName varchar(50) NOT NULL,
	phone varchar(20),
	email varchar(255),
	idAddress integer NOT NULL,
	birthDate date,
	cpf varchar(50) NOT NULL,
	active boolean,
