-- 2000 linhas
DROP TYPE status;
CREATE TYPE status AS ENUM ('active','pending','inactive');

CREATE TABLE IF NOT EXISTS public.Customers
(
	id serial NOT NULL,
	type varchar(20) NOT NULL,
	status status, 
	description varchar (255),
	idBusiness integer,
	idIndividual integer,
	delinquent integer NOT NULL,
	active boolean,
	dtCreated date,
    CONSTRAINT customers_pkey PRIMARY KEY (id),
	CONSTRAINT customers_type_fkey FOREIGN KEY (type)
        REFERENCES public.CustomerType (type) MATCH SIMPLE,
	CONSTRAINT customers_individuals_fkey FOREIGN KEY (idIndividual)
        REFERENCES public.Individuals (id) MATCH SIMPLE,
	CONSTRAINT customers_enterprises_fkey FOREIGN KEY (idBusiness)
        REFERENCES public.Enterprises (id) MATCH SIMPLE
);

