-- 03 linhas
CREATE TABLE IF NOT EXISTS public.TransferStatus
(
	status varchar(20) NOT NULL,
	active boolean,
	dtCreated date,
    CONSTRAINT transferstatus_pkey PRIMARY KEY (status)
);


-- 5000 linhas
CREATE TABLE IF NOT EXISTS public.Transfers
(
	id integer NOT NULL,
	idRecipient integer NOT NULL,
	amount float NOT NULL DEFAULT(0),
	transferDate date NOT NULL,
	idBankAccount integer NOT NULL,
	status varchar(20) NOT NULL,
	statementDescriptor varchar(255),
	transferNumber integer,
	type varchar(20) NOT NULL,
	delinquent integer NOT NULL,
    CONSTRAINT transfers_pkey PRIMARY KEY (id),
	CONSTRAINT transfers_accounts_fkey FOREIGN KEY (idBankAccount)
        REFERENCES public.Accounts (id) MATCH SIMPLE,
	CONSTRAINT transfers_recipient_fkey FOREIGN KEY (idRecipient)
        REFERENCES public.Customers (id) MATCH SIMPLE
);



